import React from "react";
import "./css-components/slide-show.css";

function SlideShow() {
  return (
    <div className="bar">
      <div className="slide-wrapper">
        <div className="slide">
          <h1 className="slide-number">1</h1>
        </div>
        <div className="slide">
          <h1 className="slide-number">2</h1>
        </div>
      </div>
    </div>
  );
}

export default SlideShow;
